func verify(i []byte, index int, t *testing.T) {
	res, err := ParseJavaSerialized(i)
	if err != nil {
		panic(err)
	}
	raw := MarshalJavaObjects(res...)
	println(codec.EncodeToHex(raw))
	if !bytes.Equal(raw, i) {
		log.Errorf("index: %v error! origin len: %v  target len: %v", index, len(i), len(raw))

		//panic(utils.Errorf("marshal failed: index:%v", index))

		raw2Elements, err := ParseJavaSerialized(raw)
		if err != nil {
			panic(err)
			return
		}
		raw2 := MarshalJavaObjects(raw2Elements...)
		println(codec.EncodeToHex(i))
		println(codec.EncodeToHex(raw))
		println(codec.EncodeToHex(raw2))

		println(strconv.Quote(string(i)))
		println(strconv.Quote(string(raw)))
		println(strconv.Quote(string(raw2)))

		for _, i := range raw2Elements {
			raw, err := ToJson(i)
			if err != nil {
				panic(err)
				return
			}

			obj, _ := FromJson(raw)
			raw2, _ = ToJson(obj[0])
			if !bytes.Equal(raw, raw2) {
				panic(1)
			}
		}
	} else {
		println(fmt.Sprintf("payload%v rebuild finished!!!", index))
	}
}

