func TestParseJavaSerialized(t *testing.T) {
	test := assert.New(t)

	payload := payload0

	var (
		r   []JavaSerializable
		err error
	)

	r, err = ParseJavaSerialized(payload)
	if err != nil {
		test.FailNow(err.Error())
		return
	}
	_ = r
	raw2 := MarshalJavaObjects(r...)
	s1 := string(payload)
	s2 := string(raw2)

	res, err := ParseJavaSerialized(raw2)
	if err != nil {
		log.Errorf(err.Error())
		panic(1)
		return
	}
	_ = res

	println(codec.Md5(s1))
	println(codec.Md5(s2))

	println(strconv.Quote(s1))
	println(strconv.Quote(s2))

	// \x00\x03[[B[\x00\x06_class
	println(codec.EncodeToHex(payload[:]))
	println(codec.EncodeToHex(MarshalJavaObjects(r...)))

	for _, r := range res {
		raw, err := json.Marshal(r)
		if err != nil {
			continue
		}
		println(string(raw))
	}
}

func TestParseHexJavaSerialized(t *testing.T) {
	res, _ := strconv.Unquote(`"q\x00~\x00\x00"`)
	spew.Dump(codec.EncodeToHex(res))

	res, _ = strconv.Unquote(`"xpr\x00\x10x\x71"`)
	spew.Dump(codec.EncodeToHex(res))

	res, _ = strconv.Unquote(`"q\x00~\x00:"`)
	spew.Dump(codec.EncodeToHex(res))

	for i := range make([]int, 16) {
		target := 0x70 + byte(i)
		fmt.Printf("%02x: %v\n", target, string([]byte{target}))
	}

	for i := range make([]int, 16) {
		target := 0x40 + byte(i)
		fmt.Printf("%02x: %v\n", target, string([]byte{target}))
	}
}
func TestParseTwoByteCharUtf(t *testing.T) {
	s := utils.RandStringBytes(8)
	javaString := NewJavaString(s)
	cfg := NewMarshalContext()
	cfg.StringCharLength = 2
	sers, err := ParseJavaSerialized(MarshalJavaObjectWithConfig(javaString, cfg))
	if err != nil {
		t.Fatal(err)
	}
	if len(sers) != 1 {
		t.Fatal("parse failed")
	}
	javaString = sers[0].(*JavaString)
	assert.Equal(t, javaString.Value, s)

	cfg.StringCharLength = 3
	sers, err = ParseJavaSerialized(MarshalJavaObjectWithConfig(javaString, cfg))
	if err != nil {
		t.Fatal(err)
	}
	if len(sers) != 1 {
		t.Fatal("parse failed")
	}
	javaString = sers[0].(*JavaString)
	assert.Equal(t, javaString.Value, s)

}
